j95rTzNFVZiriII9.pdf',1,'Стоимость обучения ординаторов первого года обучения для иностранных граждан (2020-2021 учебный год).pdf','file','6kudt32i2v2m3h1ev4r168',NULL,517,'2020-06-24 06:14:36','2020-06-24 06:17:22','pdf'),(520,'Правила приема на обучение по образовательным программам высшего образования – программам ординатуры',NULL,0,NULL,'files',NULL,62,NULL,'2020-06-24 06:24:40','2020-06-24 07:54:14',NULL),(521,'Правила приёма в ординатуру (2020)','mpL7skom0RS8keHrXXq0FQB6tRnEE5OOl5sclRSK.pdf',0,'Правила приема в ординатуру (2020).pdf','file','pnprdidosof467p4l9vnb',NULL,520,'2020-06-24 06:24:40','2020-06-24 07:38:15','pdf'),(522,'',NULL,0,'<p>&nbsp;Университет осуществляет прием по следующим условиям поступления на обучение (далее условия поступления) с проведением отдельного конкурса по каждой совокупности этих условий:</p><p><br></p><p>&nbsp;&nbsp;- раздельно по программам ординатуры в зависимости от специальности;</p><p><br></p><p>&nbsp;&nbsp;- раздельно в рамках контрольных цифр и по договорам об оказании платных образовательных услуг;</p><p><br></p><p>&nbsp;&nbsp;- раздельно на места в пределах целевой квоты и на места в рамках контрольных цифр за вычетом целевой квоты (далее основные места в рамках контрольных цифр);</p><p><br></p><p>&nbsp;&nbsp;- раздельно на места для приема граждан Российской Федерации, лиц, указанных в пункте 9.3 и 9.5. Правил приема в ординатуру, и иных иностранных граждан, лиц без гражданства.</p>','text',NULL,63,NULL,'2020-06-24 06:27:32','2020-06-24 06:50:35',NULL),(424,'II. ВСТУПИТЕЛЬНЫЕ ИСПЫТАНИЯ',NULL,2,'<p class=\"ql-align-justify\">	<strong style=\"color: black;\">1.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</strong>Для поступления на программы магистратуры поступающий сдает междисциплинарный экзамен по программе соответствующего бакалавриата, которые размещены по ссылке: https://abiturs.mrsu.ru/Magistratura-Normativnie-dokumenti.</p><p class=\"ql-align-justify\">	<strong style=\"color: black;\">2.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</strong>Лица, не прошедшие вступительное испытание по уважительной причине (болезнь или иные обстоятельства, подтвержденные <strong><u>документально</u></strong>), допускаются к сдаче вступительного испытания в другой группе или в резервный день.</p><p class=\"ql-align-justify\">	<strong style=\"color: black;\">3.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</strong>Вступительные испытания организуются и проводятся с использованием средств информационно-коммуникационной сети «Интернет»&nbsp;в режиме видеоконференции или тестирования.&nbsp;&nbsp;&nbsp;</p><p class=\"ql-align-justify\">	Поступающие, участвующие во вступительных испытаниях, должны обеспечить наличие следующих компонентов: </p><p class=\"ql-align-justify\">	1) компьютер (операционная система не ниже Windows 7, macOS 11 и выше) с веб-камерой (встроенная, либо внешняя) с разрешением не менее 640х480 или смартфон (операционной системой Android не ниже 5.0, IOS не ниже 11.0) с камерой.</p><p class=\"ql-align-justify\">	2) канал доступа в информационно-коммуникационную сеть «Интернет» пропускной способностью не менее 5 Мбит/с.</p><p class=\"ql-align-justify\">	Техническое сопровождение организации и проведения вступительных испытаний со стороны университета осуществляется сотрудниками технического секретариата приемной комиссии, а также соответствующих подразделений университета. </p><p class=\"ql-align-justify\">	<strong style=\"color: black;\">4.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</strong>&nbsp;Перед началом вступительного испытания ответственное лицо из состава технического секретариата приемной комиссии (далее – ответственное лицо) осуществляет идентификацию личности поступающего средствами телеконференцсвязи, определенной университетом, путём визуальной сверки предоставленной фотографии поступающего, документа удостоверяющего личность, с лицом, вышедшим на связь. В ходе идентификации также должны быть подтверждены персональные данные поступающего, указанные в заявлении (дата рождения, паспортные данные, адрес регистрации места жительства). </p><p class=\"ql-align-justify\">	Ответственное лицо проверяет состояние рабочего места поступающего. Для этого, с помощью веб-камеры поступающий должен обеспечить последовательный подробный обзор рабочего места для контроля присутствия посторонних лиц, справочной литературы и др. Во время вступительного испытания запрещается выключать видео- и аудио-режим трансляции. В случае обрыва связи, абитуриент должен немедленно возобновить соединение.</p><p class=\"ql-align-justify\">	<strong>5.</strong> &nbsp;Ход проведения вступительных испытаний: </p><p class=\"ql-align-justify\">	1) в форме тестирования – организуется на образовательном портале университета. С правилами тестирования и временем, которое отводится на выполнение заданий, поступающий знакомится на сайте&nbsp;перед тестированием. После завершения тестирования или истечения времени, которое отводится на выполнение заданий, выставляется оценка в соответствии с критериями оценки знаний. </p><p class=\"ql-align-justify\">	2) в форме устного экзамена – организуется средствами видеоконференцсвязи, определенной университетом: поступающий получает экзаменационные задания (билеты, вопросы для собеседования), определенные на сайте случайным образом; подготовка к ответу осуществляется непосредственно за тем же рабочим местом, где состоялась процедура идентификации. При подготовке к ответу оставляет записи на листе устного ответа, который затем сканируется (фотографируется) и размещается в личном кабинете поступающего. Через 30 минут, выделенных на подготовку, отвечает экзаменационной комиссии в режиме непосредственного общения с помощью средств телеконференцсвязи.</p><p class=\"ql-align-justify\">	<strong>6.</strong> &nbsp;Во время проведения вступительного испытания поступающий может пользоваться только письменными принадлежностями и чистыми листами. Во время проведения вступительного испытания поступающему запрещается пользоваться средствами связи.</p><p class=\"ql-align-justify\">	<strong>7.</strong> &nbsp;При нарушении поступающим во время проведения вступительного испытания с использованием дистанционных технологий настоящих Правил члены экзаменационной комиссии составляют акт о нарушении Правил.&nbsp;Электронная копия указанного акта направляется поступающему.&nbsp;Поступающий, в отношении которого составлен акт, признается не прошедшим вступительное испытание без уважительной причины. </p><p class=\"ql-align-justify\">	Лица, не прошедшие вступительное испытание по уважительной причине (болезнь или иные обстоятельства, подтвержденные документально), допускаются к сдаче вступительного испытания в другой группе или в резервный день.</p><p class=\"ql-align-justify\">	<strong>8.</strong> &nbsp;В целях обеспечения контроля за проведением вступительных испытаний осуществляется видеозапись, о чем поступающего предупреждает ответственное лицо. Видеозаписи хранятся 1 год в электронной информационно-образовательной среде университета и могут быть использованы при рассмотрении апелляций.&nbsp;&nbsp;&nbsp;</p><p class=\"ql-align-justify\">	<strong>9.</strong> Объявление оценок, полученных поступающими в ходе вступительных испытаний осуществляется на официальном сайте в следующем порядке: </p><p class=\"ql-align-justify\">	– по письменным формам испытаний – не позднее трех рабочих со времени проведения испытания; </p><p class=\"ql-align-justify\">	– по устной форме – в течение 30 минут после ответа в режиме телеконференцсвязи, а также публикуются на официальном сайте не позднее следующего рабочего дня со времени проведения испытания.</p><p>&nbsp;</p>','text',NULL,51,NULL,'2020-06-19 07:52:38','2020-06-19 07:52:38',NULL),(425,'III. ПРОЦЕДУРА ЗАЧИСЛЕНИЯ В УНИВЕРСИТЕТ',NULL,3,'<p class=\"ql-align-justify\">	<strong style=\"color: black;\">1.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</strong>По результатам приема документов и (или) вступительных испытаний Университет формирует списки поступающих (далее – списки поступающих). </p><p class=\"ql-align-justify\"><strong style=\"color: black;\">2. </strong><span style=\"color: black;\">Конкурсные списки ранжируются по убыванию суммы конкурсных баллов (сумма баллов за вступительные испытания + баллы за индивидуальные достижения. </span></p><p class=\"ql-align-justify\">	<strong style=\"color: black;\">3.</strong><span style=\"color: black;\"> Для зачисления, поступающие </span><strong style=\"color: red;\">тем же способом, что были поданы документы для участия в конкурсе на зачисление,</strong><span style=\"color: red;\"> &nbsp;</span><span style=\"color: black;\">представляют не позднее 18.00 по местному времени рабочего дня, установленного Университетом в качестве даты завершения приема документов, необходимых для поступления, </span><strong style=\"color: red;\">согласие на зачисление</strong><span style=\"color: black;\">. </span></p><p class=\"ql-align-justify\">	<span style=\"color: black;\">В списках поступающих по каждому поступающему указывается наличие в университете согласия на зачисление. </span></p><p class=\"ql-align-justify\">	<strong style=\"color: black;\">4.</strong><span style=\"color: black;\"> </span>Зачисление поступающих проводится в направлении от начала к концу списка поступающих, до заполнения имеющихся мест для приема.</p><p class=\"ql-align-justify\">	<strong>5.</strong> Процедуры зачисления поступающих на обучение по программам магистратуры по <strong>очной</strong> и <strong>очно-заочной</strong> формам обучения на места в рамках контрольных цифр проводятся в следующие сроки:</p><p class=\"ql-align-justify\">	а) размещение на официальном сайте и на информационном стенде списков поступающих – <strong><u>10 августа</u></strong>;</p><p class=\"ql-align-justify\">	б) зачисление поступающих на места в пределах квоты целевого обучения:</p><p class=\"ql-align-justify\">	<strong><u>12 августа в 18.00</u></strong><u>: </u></p><p class=\"ql-align-justify\">	завершается прием <strong style=\"color: red;\">согласия на зачисление</strong><span style=\"color: red;\"> </span>от лиц, поступающих на места в пределах квоты целевого обучения;</p><p class=\"ql-align-justify\">	<strong><u>13 августа</u> &nbsp;</strong>&nbsp;издается и размещается на официальном сайте приказ (приказы) о зачислении поступающих на места в пределах квоты целевого обучения, представивших согласие на зачисление;</p><p class=\"ql-align-justify\">	в) этап зачисления по общему конкурсу:</p><p class=\"ql-align-justify\">	<strong><u>13 августа</u> </strong>количество конкурсных мест в соответствующих конкурсных списках на места в рамках контрольных цифр по общему конкурсу увеличивается на количество мест, оставшихся вакантными в пределах квоты целевого обучения;</p><p class=\"ql-align-justify\">	<strong><u>13 августа в 18.00: </u></strong></p><p class=\"ql-align-justify\">	завершается прием согласия на зачисление от лиц, включенных в конкурсный список, желающих быть зачисленными на этапе зачисления по общему конкурсу;</p><p class=\"ql-align-justify\">	в рамках каждого конкурсного списка формируется список, включающий в себя лиц, представивших оригинал документа установленного образца и согласие на зачисление, до заполнения 100 процентов конкурсных мест по общему конкурсу;</p><p class=\"ql-align-justify\">	<strong><u>14 августа</u> &nbsp;</strong>&nbsp;издается и размещается на официальном сайте приказ (приказы) о зачислении лиц, включенных в списки этапа зачисления по общему конкурсу. </p><p class=\"ql-align-justify\">	<strong>6.</strong> Процедуры зачисления поступающих на обучение по программам магистратуры по <strong>заочной</strong> форме обучения на места в рамках контрольных цифр проводятся в следующие сроки:</p><p class=\"ql-align-justify\">	а) размещение на официальном сайте и на информационном стенде списков поступающих – <strong><u>12 августа</u></strong>;</p><p class=\"ql-align-justify\">	б) зачисление поступающих на места в пределах квоты целевого обучения:</p><p class=\"ql-align-justify\">	<strong><u>13 августа в 18.00</u></strong><u>: </u></p><p class=\"ql-align-justify\">	завершается прием <strong style=\"color: red;\">согласия на зачисление</strong><span style=\"color: red;\"> </span>от лиц, поступающих на места в пределах квоты целевого обучения;</p><p class=\"ql-align-justify\">	<strong><u>14 августа</u> &nbsp;</strong>&nbsp;издается и размещается на официальном сайте приказ (приказы) о зачислении поступающих на места в пределах квоты целевого обучения, представивших согласие на зачисление;</p><p class=\"ql-align-justify\">	в) этап зачисления по общему конкурсу:</p><p class=\"ql-align-justify\">	<strong><u>14 августа</u> </strong>количество конкурсных мест в соответствующих конкурсных списках на места в рамках контрольных цифр по общему конкурсу увеличивается на количество мест, оставшихся вакантными в пределах квоты целевого обучения;</p><p class=\"ql-align-justify\">	<strong><u>14 августа в 18.00: </u></strong></p><p class=\"ql-align-justify\">	завершается прием согласия на зачисление от лиц, включенных в конкурсный список, желающих быть зачисленными на этапе зачисления по общему конкурсу;</p><p class=\"ql-align-justify\">	в рамках каждого конкурсного списка формируется список, включающий в себя лиц, представивших оригинал документа установленного образца и согласие на зачисление, до заполнения 100 процентов конкурсных мест по общему конкурсу;</p><p class=\"ql-align-justify\">	<strong><u>15 августа</u> &nbsp;</strong>&nbsp;издается и размещается на официальном сайте приказ (приказы) о зачислении лиц, включенных в списки этапа зачисления по общему конкурсу. </p><p class=\"ql-align-justify\">	<strong>7.</strong> При приеме <strong>на места по договорам об оказании платных образовательных услуг</strong> (платное обучение) по программам магистратуры &nbsp;по очной, очно-заочной и заочной формам обучения:</p><p class=\"ql-align-justify\">	а) размещение списков поступающих на официальном сайте и на информационном стенде – <strong><u>28 августа</u></strong>;</p><p class=\"ql-align-justify\">	б) зачисление по результатам вступительных испытаний на места по договорам об оказании платных образовательных услуг (платное обучение):</p><p class=\"ql-align-justify\">	<strong><u>29 августа</u></strong> завершается прием заявлений о согласии на зачисление;</p><p class=\"ql-align-justify\">	<strong><u>31 августа</u></strong> издается приказ (приказы) о зачислении.</p><p class=\"ql-align-justify\">	<strong style=\"color: red;\">ВАЖНО! Обязательным условием зачисления на места с оплатой стоимости обучения является заключение договора об оказании платных образовательных услуг и внесение предоплаты, размер которой согласуется при заключении договора.</strong></p><p><br></p>','text',NULL,51,NULL,'2020-06-19 07:53:15','2020-06-19 07:53:15',NULL),(532,'Репетиционный экзамен',NULL,0,'<p>Вступительное испытание проводится в форме тестирования.</p><p>Пройти репетиционное тестирование можно на сайте Методического центра аккредитации.</p><p>Количество попыток не ограничено.</p><p><br></p><p>Комплектование набора тестовых заданий осуществляется программным обеспечением из единой базы оценочных средств.</p><p><br></p><p>Перед прохождением репетиционного экзамена ознакомьтесь с&nbsp;<a href=\"https://fmza.ru/upload/medialibrary/0e1/instruktsiya-re_obnovl.26.03.2018-g..pdf\" rel=\"noopener noreferrer\" target=\"_blank\">Инструкцией</a>.</p><p><br></p><p><a href=\"https://selftest.mededtech.ru/\" rel=\"noopener noreferrer\" target=\"_blank\">РЕПЕТИЦИОННЫЙ ЭКЗАМЕН</a></p>','text',NULL,67,NULL,'2020-06-24 06:45:16','2020-06-24 06:45:16',NULL),(530,'',NULL,1,NULL,'files',NULL,65,NULL,'2020-06-24 06:36:58','2020-06-24 06:36:58',NULL),(531,'Сроки начала и завершения приема документов, размещения списка поступающих, сроки зачисления и издания приказов о зачислении','erfKzNsh9G02OdWC5LgTwdOVydhbpop5o1smOsFa.pdf',0,'Сроки начала и завершения приема документов, размещения списка поступающих, сроки зачисления и издания приказов о зачислении.pdf','file','72uisjoiirwclzqqy4j0fm',NULL,530,'2020-06-24 06:36:58','2020-06-24 06:36:58','pdf'),(533,'Расписание проведения тестирования (вступительное испытание) лиц, подавших документы для поступления в ординатуру',NULL,1,NULL,'files',NULL,67,NULL,'2020-06-24 06:46:25','2020-06-24 06:46:25',NULL),(534,'Расписание проведения тестирования (вступительное испытание) лиц, подавших документы для поступления в ординатуру','yqs5CRkDvy2DmSCIl9CrbwoZUVGMjCgjOE0NkgA6.pdf',0,'Расписание проведения тестирования (вступительное испытание) лиц, подавших документы для поступления в ординатуру.pdf','file','flhpvzjakj2w6p9x015u5',NULL,533,'2020-06-24 06:46:25','2020-06-24 06:46:25','pdf'),(535,'Сроки проведения вступительных испытаний в ординатуру',NULL,2,'<p><span style=\"color: rgb(73, 78, 83);\">&nbsp;&nbsp;Вступительные испытания, проводимые Университетом при приеме на обучение по программам ординатуры на места в рамках контрольных цифр приема, завершаются не позднее 11 августа 2020 г. При условии продления приема по основаниям, указанным в п. 3.15 Правил приема в ординатуру, не позднее&nbsp;</span><strong style=\"color: rgb(73, 78, 83);\">26 августа 2020 г</strong><span style=\"color: rgb(73, 78, 83);\">. Вступительные испытания, проводимые Университетом при приеме на обучение по программам ординатуры на места по договорам об оказании платных образовательных услуг, завершаются не позднее&nbsp;</span><strong style=\"color: rgb(73, 78, 83);\">27 августа 2020 г</strong><span style=\"color: rgb(73, 78, 83);\">.</span></p>','text',NULL,67,NULL,'2020-06-24 06:47:25','2020-06-24 06:47:25',NULL),(536,'Общие правила подачи и рассмотрения апелляций',NULL,3,'<p>&nbsp;1. По результатам решения экзаменационной комиссии о прохождении вступительного испытания поступающий (доверенное лицо) вправе подать в апелляционную комиссию апелляцию о нарушении, по мнению поступающего, установленного порядка проведения вступительного испытания и (или) о несогласии с полученной оценкой результатов вступительного испытания.&nbsp;</p><p><br></p><p>&nbsp;&nbsp;2. Рассмотрение апелляции не является пересдачей вступительного испытания. В ходе рассмотрения апелляции проверяется соблюдение установленного порядка проведения вступительного испытания и (или) правильность оценивания результатов вступительного испытания.</p><p><br></p><p>&nbsp;&nbsp;3. Апелляция подается одним из способов, указанных в п.3.2 настоящих Правил приема в ординатуру.</p><p><br></p><p>&nbsp;&nbsp;4. Апелляция подается в день объявления результатов вступительного испытания или в течение следующего рабочего дня. Рассмотрение апелляций проводится не позднее следующего рабочего дня после дня подачи апелляции.</p><p><br></p><p>&nbsp;&nbsp;5. При рассмотрении апелляции имеют право присутствовать поступающий (доверенное лицо), который должен иметь при себе документ, удостоверяющий его личность.</p><p><br></p><p>&nbsp;&nbsp;6. После рассмотрения апелляции апелляционная комиссия принимает решение об изменении оценки результатов вступительного испытания или оставлении указанной оценки без изменения. Оформленное протоколом решение апелляционной комиссии доводится до сведения, поступающего (доверенного лица). Факт ознакомления, поступающего (доверенного лица) с решением апелляционной комиссии заверяется подписью поступающего (доверенного лица).</p>','text',NULL,67,NULL,'2020-06-24 06:47:54','2020-06-24 06:48:29',NULL),(537,NULL,NULL,0,'<p><span style=\"color: rgb(73, 78, 83);\">Количество мест в общежитиях ФГБОУ ВО «МГУ им. Н.П. Огарёва» для иногородних поступающих в 2020 году - 80 мест.</span></p>','text',NULL,68,NULL,'2020-06-24 06:49:54','2020-06-24 06:49:54',NULL),(540,'',NULL,0,NULL,'files',NULL,70,NULL,'2020-06-24 07:35:02','2020-06-24 07:35:02',NULL),(541,'План целевого приёма в ординатуру в 2020 году','LAt19vpkmDXlpg6WqPfElqaXrjbRXwMhP1tVw9tG.pdf',0,'План целевого приема в ординатуру на 2020 год.pdf','file','bxcw150n75e0zxlcchwdxhq',NULL,540,'2020-06-24 07:35:02','2020-06-24 07:35:02','pdf'),(542,'Детализация целевого приёма','TcPVfj242fA9gq4vcdNvvr6fW7BWtIRbCHWZAkQw.pdf',1,'Детализация целевого приёма.pdf','file','u2tnar6c37mwqliu2q16h8',NULL,540,'2020-06-24 07:35:02','2020-06-24 07:35:02','pdf'),(544,'Условия поступления',NULL,1,'<p>&nbsp;Университет осуществляет прием по следующим условиям поступления на обучение (далее условия поступления) с проведением отдельного конкурса по каждой совокупности этих условий:</p><p><br></p><p>&nbsp;&nbsp;- раздельно по программам ординатуры в зависимости от специальности;</p><p><br></p><p>&nbsp;&nbsp;- раздельно в рамках контрольных цифр и по договорам об оказании платных образовательных услуг;</p><p><br></p><p>&nbsp;&nbsp;- раздельно на места в пределах целевой квоты и на места в рамках контрольных цифр за вычетом целевой квоты (далее основные места в рамках контрольных цифр);</p><p><br></p><p>&nbsp;&nbsp;- раздельно на места для приема граждан Российской Федерации, лиц, указанных в пункте 9.3 и 9.5. Правил приема в ординатуру, и иных иностранных граждан, лиц без гражданства.</p>','text',NULL,62,NULL,'2020-06-24 07:50:29','2020-06-24 07:50:29',NULL),(543,'Образец договора об оказании платных образовательных услуг','lICuXrZjmpwu8BYVaR9eL43cs4gsNgmyjBBi1XtV.pdf',2,'Договор_ВО.pdf','file','5ram7y2lg3kze1mydswaf',NULL,517,'2020-06-24 07:40:16','2020-06-24 07:40:16','pdf'),(545,'Количество мест для приема на обучение по различным условиям поступления',NULL,2,NULL,'files',NULL,62,NULL,'2020-06-24 07:50:29','2020-06-24 07:50:29',NULL),(546,'Контрольные цифры приёма','RQpuD8fLEew149OhbWk5AptXoTXG7xdZUZ9VdfHN.pdf',0,'Контрольные цифры приёма (2020).pdf','file','6n7l6ktj1rounui99h9ehf',NULL,545,'2020-06-24 07:50:29','2020-06-24 07:50:29','pdf'),(547,'План целевого приёма в ординатуру в 2020 году','hTU1nn0ejVAPJUWVjvjYct7k0CzWtMowfE6smOVU.pdf',1,'План целевого приёма в ординатуру на 2020 год.pdf','file','42d6qahbjemfc7a3qtfobl',NULL,545,'2020-06-24 07:50:2