:00','pdf'),(474,'Правила подачи апелляции','3niF3Wq3sv84RVu2NtWksyk3oGILLkJcM4ndLc3K.pdf',4,'Правила подачи апелляции.pdf','file','3ilm24jbo8biurw6s35c7d',NULL,469,'2020-06-23 13:55:54','2020-06-23 13:55:54','pdf'),(467,'Условия поступления в аспирантуру','LLtOs5yC3pUI8sw2BbFjbLhtJj4VHu5wehMeJ7fI.pdf',3,'Условия поступления в аспирантуру.pdf','file','zutxblnmag9wjnlyj1thua',NULL,46,'2020-06-23 12:48:30','2020-06-25 08:32:52','pdf'),(471,'Особенности проведения вступительных испытаний для инвалидов','GkG8UTAs9aCbUNUfbEME1NLeFTfCzdjUaqQNok2Q.pdf',1,'Особенности проведения вступительных испытаний для инвалидов..pdf','file','smfyokxc19ir6k2k21qh09',NULL,469,'2020-06-23 13:55:54','2020-06-23 13:55:54','pdf'),(472,'Программы вступительных испытаний','DnSiENwnPMzSm9WQolTCiVFYJhA118x867LAxT8I.pdf',2,'Программы вступительных испытаний..pdf','file','f62gogr4xb1neskguktob',NULL,469,'2020-06-23 13:55:54','2020-06-23 13:55:54','pdf'),(473,'Сроки проведения вступительных испытаний','J6HvKmNCA1ns6SYPD3Ac7Ul5VWlqK06H78e7GprF.pdf',3,'Сроки проведения вступительных испытаний..pdf','file','iv79se82pylxct1hh243r',NULL,469,'2020-06-23 13:55:54','2020-06-23 13:55:54','pdf'),(67,'ИНФОРМАЦИЯ О СРОКАХ ПРОВЕДЕНИЯ ПРИЁМА',NULL,2,NULL,'files',NULL,1,NULL,'2020-05-29 11:41:19','2020-05-29 11:42:01',NULL),(68,'Информация о сроках проведения приёма','oh9NS466m4RPu2TNoWJWDDtQSBgCNQ3ls1oLf4zo.pdf',0,'График приемной кампании.pdf','file','di8nw7gc67pzwajjfhlxa9',NULL,67,'2020-05-29 11:41:19','2020-06-19 13:56:24','pdf'),(69,'ПЕРЕЧЕНЬ ВСТУПИТЕЛЬНЫХ ИСПЫТАНИЙ С УКАЗАНИЕМ ПРИОРИТЕТНОСТИ ВСТУПИТЕЛЬНЫХ ИСПЫТАНИЙ ПРИ РАНЖИРОВАНИИ СПИСКОВ ПОСТУПАЮЩИХ; МИНИМАЛЬНОЕ КОЛИЧЕСТВО БАЛЛОВ',NULL,3,NULL,'files',NULL,1,NULL,'2020-05-29 11:45:31','2020-05-29 11:45:31',NULL),(70,'Перечень вступительных испытаний, минимальное количество баллов, информация о приоритетности вступительных испытаний','Ns2Lz7ZEH8Cp7LgsQYJGXSXI7MMMx4bKwDAdbboZ.pdf',0,'Перечень вступительных испытаний, минимальное количество баллов, информация о приоритетности ВИ.pdf','file','wpr38waba5ecn52qu943g',NULL,69,'2020-05-29 11:45:31','2020-05-29 11:45:31','pdf'),(71,'Перечень вступительных испытаний по конкурсам для иностранных граждан, минимальное количество баллов, информация о приоритетности вступительных испытаний','HJmv8ySlz2NaPsshNEcBQ4hXEPOOLKzsQynv9BY3.pdf',1,'Перечень вступительных испытаний по конкурсам для иностранных граждан, минимальное количество баллов, информация о приоритетности ВИ.pdf','file','wmxkgrknvutbws2j8he7f',NULL,69,'2020-05-29 11:45:31','2020-05-29 11:45:31','pdf'),(72,'СТАТИСТИКА ПРОХОДНЫХ БАЛЛОВ ЗА ПРОШЛЫЕ ГОДЫ',NULL,4,NULL,'files',NULL,1,NULL,'2020-05-29 11:47:13','2020-05-29 11:47:13',NULL),(73,'Проходной балл 2017-2019','658olks7tVe4hIsRorbTdTE4lnFoLn9YJeywbNK7.pdf',0,'Проходной балл 2017-2019.pdf','file','4ysg9gcwigfh1283u16qjc',NULL,72,'2020-05-29 11:47:13','2020-05-29 11:47:13','pdf'),(74,'ИНФОРМАЦИЯ О ФОРМАХ ПРОВЕДЕНИЯ ВСТУПИТЕЛЬНЫХ ИСПЫТАНИЙ, ПРОВОДИМЫХ УНИВЕРСИТЕТОМ САМОСТОЯТЕЛЬНО',NULL,5,NULL,'files',NULL,1,NULL,'2020-05-29 11:48:28','2020-05-29 11:48:28',NULL),(75,'Информация о формах проведения вступительных испытаний, проводимых университетом самостоятельно','1QuzyzyiWK1fo3kvk3qSkDIfq06jp7kn0F7YYigT.pdf',0,'Информация о формах проведения вступительных испытаний, проводимых университетом самостоятельно.pdf','file','yo1dovwm2ff1mjiuu59p',NULL,74,'2020-05-29 11:48:28','2020-05-29 11:48:28','pdf'),(77,'I. ПРИЁМ ДОКУМЕНТОВ',NULL,0,'<p>	<strong>1.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</strong>Начало приема документов, необходимых для поступления, на все формы обучения и направления подготовки – <strong><u>20 июня</u></strong>. Прием документов осуществляется ТОЛЬКО дистанционно!</p><p>	В личном кабинете абитуриента необходимо предоставить:</p><p>	– скан документа, удостоверяющего личность;</p><p>	– скан документа об образовании (аттестат, диплом);</p><p class=\"ql-align-justify\">	– документы, удостоверяющие право на получение льгот, преимущественного права или подтверждение индивидуальных достижений (если имеются);</p><p>	– скан договора о целевом обучении (если имеется);</p><p class=\"ql-align-justify\">	– сканы документов, подтверждающих наличие индивидуальных достижений (удостоверение к золотому значку ГТО, книжка волонтера, дипломы или сертификаты, подтверждающие участие в олимпиадах и т.д.).</p><p class=\"ql-align-justify\">	<strong>2.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</strong>Абитуриенты, поступающие на основании аттестата о среднем общем образовании, должны иметь результаты ЕГЭ. Отдельные категории поступающих на базе среднего общего образования могут по своему усмотрению поступать на обучение по результатам общеобразовательных вступительных испытаний, проводимых университетом самостоятельно (раздел II Памятки).</p><p class=\"ql-align-justify\">	<strong>3.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</strong>Все поступающие, независимо от уровня, формы и&nbsp;условий получения образования, в соответствии с законодательством должны представить в приемную комиссию <strong style=\"color: red;\">согласие на зачисление </strong><span style=\"color: black;\">тем же способом, каким было подано заявление на участие в конкурсе, то есть дистанционно</span>.&nbsp;Лица, не представившие в установленные сроки согласие на зачисление, зачислены не будут. </p><p class=\"ql-align-center\"><strong style=\"color: red;\">ВАЖНО! Оригинал документа об образовании нужно будет предоставить в вуз в течение первого года обучения!</strong></p><p class=\"ql-align-justify\">	<strong>4.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</strong>При приеме на обучение по программам бакалавриата и специалитета по <strong>очной</strong> и <strong>очно-заочной</strong> формам обучения в рамках контрольных цифр устанавливаются следующие сроки завершения приема документов, необходимых для поступления:</p><p class=\"ql-align-justify\">– от лиц, поступающих по результатам ЕГЭ – <strong><u>18 августа;&nbsp;</u></strong></p><p class=\"ql-align-justify\"><strong>– от лиц, поступающих по результатам проводимых университетом самостоятельно вступительных испытаний (в том числе дополнительных вступительных испытаний творческой и (или) профессиональной направленности), – <u>6 августа</u></strong>.</p><p class=\"ql-align-justify\">	<strong>5.</strong> При приеме на обучение по программам бакалавриата и специалитета по <strong>очной</strong> и <strong>очно-заочной</strong> формам обучения по договорам об оказании платных образовательных услуг устанавливаются следующие сроки завершения приема документов, необходимых для поступления:</p><p class=\"ql-align-justify\">	– от лиц, поступающих на обучение &nbsp;по результатам ЕГЭ, – &nbsp;<strong><u>26 августа</u></strong>; </p><p class=\"ql-align-justify\">	– от лиц, поступающих по результатам проводимых университетом самостоятельно вступительных испытаний (в том числе дополнительных вступительных испытаний творческой и (или) профессиональной направленности), – <strong><u>20 августа</u></strong>.</p><p class=\"ql-align-justify\">	<strong>6.</strong> При приеме на обучение по программам бакалавриата и специалитета по <strong>заочной</strong> форме обучения в рамках контрольных цифр &nbsp;устанавливаются следующие сроки завершения приема документов, необходимых для поступления:</p><p class=\"ql-align-justify\">	– от лиц, поступающих по результатам ЕГЭ – <strong><u>22 августа</u></strong>;</p><p class=\"ql-align-justify\">	– от лиц, поступающих на обучение по результатам проводимых университетом самостоятельно вступительных испытаний, – <strong><u>15 августа</u></strong>.</p><p class=\"ql-align-justify\">	<strong>7.</strong> При приеме на обучение по программам бакалавриата и специалитета по <strong>заочной</strong> форме обучения по договорам об оказании платных образовательных услуг устанавливаются следующие сроки завершения приема документов, необходимых для поступления:</p><p class=\"ql-align-justify\">	– от лиц, поступающих по результатам ЕГЭ – <strong><u>5 сентября</u></strong>;</p><p class=\"ql-align-justify\">	– по результатам вступительных испытаний, проводимых университетом &nbsp;самостоятельно, – &nbsp;<strong><u>12 сентября</u></strong>.</p><p class=\"ql-align-justify\">	<strong>8.</strong> Поступающий на обучение по программам бакалавриата или программам специалитета вправе подать заявление на участие в конкурсе не более чем по 3 специальностям и (или) направлениям подготовки в Университете, а также одновременно подать заявление (заявления) о приеме по результатам конкурса для обучения в Университете и его филиале (филиалах) или для обучения в нескольких филиалах, по различным формам обучения, по различным программам бакалавриата в пределах направления подготовки (программам специалитета в пределах специальности) либо по различным совокупностям программ бакалавриата в пределах направления подготовки (совокупностям программ специалитета в пределах специальности), по которым проводятся конкурсы, а также по различным видам приема, указанным в пункте 11 Правил.</p><p class=\"ql-align-justify\"><strong>9.&nbsp;<u>Право на прием без вступительных испытаний</u></strong> имеют:</p><p class=\"ql-align-justify\">	–<span style=\"color: black;\"> победители и призеры заключительного этапа всероссийской олимпиады школьников (далее – победители и призеры всероссийской олимпиады), члены сборных команд Российской Федерации, участвовавших в международных олимпиадах по общеобразовательным предметам и сформированных в порядке, установленном федеральным органом исполнительной власти, осуществляющим функции по выработке государственной политики и нормативно-правовому регулированию в сфере образования, по специальностям и (или) направлениям подготовки, соответствующим профилю всероссийской олимпиады школьников или международной олимпиады.</span></p><p class=\"ql-align-justify\">	Право на прием на обучение за счет бюджетных ассигнований в пределах установленной квоты имеют <strong>дети-инвалиды, инвалиды I и II групп, инвалиды с детства, инвалиды вследствие военной травмы или заболевания, полученных в период прохождения военной службы, дети-сироты и дети, оставшиеся без попечения родителей, а также лица из числа детей-сирот и детей, оставшихся без попечения родителей, инвалиды войны, участники боевых действий, а также ветераны боевых действий из числа лиц, указанных в подпунктах 1-4 пункта 1 статьи 3 Федерального закона от 12 января 1995 г. № 5-ФЗ «О ветеранах»</strong>. Квота приема указанных категорий поступающих устанавливается ежегодно университетом в размере 10 процентов от общего объема контрольных цифр, выделенных организации высшего образования на очередной год, по специальностям и (или) направлениям подготовки. </p><p class=\"ql-align-justify\">	<strong>10.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Преимущественное право зачисления (при прочих равных условиях) </strong>предоставляется лицам, перечисленным в п. 35 Правил приема. </p><p class=\"ql-align-justify\">	<strong>11.&nbsp;&nbsp;&nbsp;&nbsp;Победителям и призерам заключительного этапа Всероссийской олимпиады школьников по отдельным предметам </strong>предоставляются особые права (зачисление без вступительных испытаний или присвоение 100 баллов по профильному предмету) при приеме на обучение по программам бакалавриата и программам специалитета по специальностям и (или) направлениям подготовки, соответствующим профилю олимпиады школьников (Приложение 4 к Правилам приема).&nbsp;Для использования указанных особых прав наличие результатов ЕГЭ не требуется.</p><p class=\"ql-align-justify\">	<strong>12. Победителям и призерам олимпиад школьников, проводимых в порядке, устанавливаемом Минобрнауки России</strong>, предоставляются особые права (зачисление без вступительных испытаний или присвоение 100 баллов по профильному предмету) &nbsp;при приеме на обучение по программам бакалавриата и программам специалитета по специальностям и (или) направлениям подготовки, соответствующим профилю олимпиады школьников (Приложение 4 к Правилам приема). &nbsp;Для использования особого права победителям и призерам олимпиады школьников необходимо наличие результатов ЕГЭ <strong>не ниже 75 баллов ЕГЭ</strong> по общеобразовательному предмету, соответствующему профилю олимпиады.</p><p class=\"ql-align-justify\">	<strong>13.</strong> Поступающий не может одновременно подать заявление (заявления) о приеме на обучение на базе среднего общего образования и на базе профессионального образования в университете на одну и ту же образовательную программу.</p><p class=\"ql-align-justify\">	<strong>14.</strong> При поступлении на обучение по специальностям и направлениям подготовки: </p><p class=\"ql-align-justify\"><em>«Лечебное дело», «Педиатрия», «Стоматология», «Фармация», «Ветеринария», «Агроинженерия», «Теплоэнергетика и теплотехника», «Электроэнергетика и электротехника», «Эксплуатация транспортно-технологических машин и комплексов»,</em> необходима <strong>медицинская справка</strong>, содержащая сведения о проведении медицинского осмотра в порядке, установленном постановлением Правительства Российской Федерации от 14 августа 2013 г. № 697.</p><p class=\"ql-align-justify\">	Медицинская справка признается действительной, если она получена не ранее года до дня завершения приема документов и вступительных испытаний.</p><p class=\"ql-align-center\">	<strong style=\"color: red;\">ВАЖНО! Пройти медосмотр и предоставить медицинскую справку в вуз можно в течение первого года обучения!</strong></p><p><br></p>','text',NULL,27,NULL,'2020-06-04 10:54:21','2020-06-19 07:03:36',NULL),(78,'II. ВСТУПИТЕЛЬНЫЕ ИСПЫТАНИЯ',NULL,1,'<p class=\"ql-align-justify\">	<strong style=\"color: black;\">1.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</strong>По одному общеобразовательному предмету проводится одно общеобразовательное вступительное испытание.</p><p class=\"ql-align-justify\">	<strong style=\"color: black;\">2.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</strong>Поступающие по результатам ЕГЭ могут использовать:</p><p class=\"ql-align-justify\">	– результаты 2020, 2019, 2018, 2017, 2016 гг.</p><p class=\"ql-align-justify\">	Отдельные категории поступающих на базе среднего общего образования могут по своему усмотрению поступать на обучение по результатам общеобразовательных вступительных испытаний, проводимых университетом самостоятельно: </p><p class=\"ql-align-justify\">	а)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;дети-инвалиды, инвалиды;</p><p class=\"ql-align-justify\">	б)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;иностранные граждане;</p><p class=\"ql-align-justify\">	в) лица, которые прошли итоговые аттестационные процедуры в иностранных образовательных организациях, получили документ о среднем общем образовании в течение одного года до дня завершения приема документов и вступительных испытаний включительно;</p><p class=\"ql-align-justify\">	г) лица, поступающие на основании диплома о начальном профессиональном образовании, среднем профессиональном образовании или высшем образовании.</p><p class=\"ql-align-justify\">	Лица, не прошедшие вступительное испытание по уважительной причине (болезнь или иные обстоятельства, подтвержденные <strong><u>документально</u></strong>), допускаются к сдаче вступительного испытания в другой группе или в резервный день.</p><p class=\"ql-align-justify\">	<strong style=\"color: black;\">3.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</strong>Вступительные испытания организуются и проводятся с использованием средств информационно-коммуникационной сети «Интернет»&nbsp;в режиме видеоконференции или тестирования.&nbsp;&nbsp;&nbsp;</p><p class=\"ql-align-justify\">	Поступающие, участвующие во вступительных испытаниях, должны обеспечить наличие следующих компонентов: </p><p class=\"ql-align-justify\">	1) компьютер (операционная система не ниже Windows 7, macOS 11 и выше) с веб-камерой (встроенная, либо внешняя) с разрешением не менее 640х480 или смартфон (операционной системой Android не ниже 5.0, IOS не ниже 11.0) с камерой.</p><p class=\"ql-align-justify\">	2) канал доступа в информационно-коммуникационную сеть «Интернет» пропускной способностью не менее 5 Мбит/с.</p><p class=\"ql-align-justify\">	Техническое сопровождение организации и проведения вступительных испытаний со стороны университета осуществляется сотрудниками технического секретариата приемной комиссии, а также соответствующих подразделений университета. </p><p class=\"ql-align-justify\">	<strong style=\"color: black;\">4.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</strong>&nbsp;Перед началом вступительного испытания ответственное лицо из состава технического секретариата приемной комиссии (далее – ответственное лицо) осуществляет идентификацию личности поступающего средствами телеконференцсвязи, определенной университетом, путём визуальной сверки предоставленной фотографии поступающего, документа удостоверяющего личность, с лицом, вышедшим на связь. В ходе идентификации также должны быть подтверждены персональные данные поступающего, указанные в заявлении (дата рождения, паспортные данные, адрес регистрации места жительства). </p><p class=\"ql-align-justify\">	Ответственное лицо проверяет состояние рабочего места поступающего. Для этого, с помощью веб-камеры поступающий должен обеспечить последовательный подробный обзор рабочего места для контроля присутствия посторонних лиц, справочной литературы и др. Во время вступительного испытания запрещается выключать видео- и аудио-режим трансляции. В случае обрыва связи, абитуриент должен немедленно возобновить соединение.</p><p class=\"ql-align-justify\">	<strong>5.</strong> &nbsp;Ход проведения вступительных испытаний: </p><p class=\"ql-align-justify\">	1) в форме тестирования – организуется на образовательном портале университета. С правилами тестирования и временем, которое отводится на выполнение заданий, поступающий знакомится на сайте&nbsp;перед тестированием. После завершения тестирования или истечения времени, которое отводится на выполнение заданий, выставляется оценка в соответствии с критериями оценки знаний. </p><p class=\"ql-align-justify\">	2) в форме устного экзамена – организуется средствами видеоконференцсвязи, определенной университетом: поступающий получает экзаменационные задания (билеты, вопросы для собеседования), определенные на сайте случайным образом; подготовка к ответу осуществляется непосредственно за тем же рабочим местом, где состоялась процедура идентификации. При подготовке к ответу оставляет записи на листе устного ответа, который затем сканируется (фотографируется) и размещается в личном кабинете поступающего. Через 30 минут, выделенных на подготовку, отвечает экзаменационной комиссии в режиме непосредственного общения с помощью средств телеконференцсвязи.</p><p class=\"ql-align-justify\">	<strong>6.</strong> &nbsp;Во время проведения вступительного испытания поступающий может пользоваться только письменными принадлежностями и чистыми листами. Во время проведения вступительного испытания поступающему запрещается пользоваться средствами связи.</p><p class=\"ql-align-justify\">	<strong>7.</strong> &nbsp;При нарушении поступающим во время проведения вступительного испытания с использованием дистанционных технологий настоящих Правил члены экзаменационной комиссии составляют акт о нарушении Правил.&nbsp;Электронная копия указанного акта направляется поступающему.&nbsp;Поступающий, в отношении которого составлен акт, признается не прошедшим вступительное испытание без уважительной причины. </p><p class=\"ql-align-justify\">	Лица, не прошедшие вступительное испытание по уважительной причине (болезнь или иные обстоятельства, подтвержденные документально), допускаются к сдаче вступительного испытания в другой группе или в резервный день.</p><p class=\"ql-align-justify\">	<strong>8.</strong> &nbsp;В целях обеспечения контроля за проведением вступительных испытаний осуществляется видеозапись, о чем поступающего предупреждает ответственное лицо. Видеозаписи хранятся 1 год в электронной информационно-образовательной среде университета и могут быть использованы при рассмотрении апелляций.&nbsp;&nbsp;&nbsp;</p><p class=\"ql-align-justify\">	<strong>9.</strong> Объявление оценок, полученных поступающими в ходе вступительных испытаний осуществляется на официальном сайте в следующем порядке: </p><p class=\"ql-align-justify\">	– по письменным формам испытаний – не позднее трех рабочих со времени проведения испытания; </p><p class=\"ql-align-justify\">	– по устной форме – в течение 30 минут после ответа в режиме телеконференцсвязи, а также публикуются на официальном сайте не позднее следующего рабочего дня со времени проведения испытания.</p><p><br></p>','text',NULL,27,NULL,'2020-06-04 11:14:55','2020-06-19 06:47:04',NULL),(79,'III. ПРОЦЕДУРА ЗАЧИСЛЕНИЯ В УНИВЕРСИТЕТ',NULL,2,'<p class=\"ql-align-justify\">	<strong style=\"color: black;\">1.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</strong>По результатам приема документов и (или) вступительных испытаний Университет формирует списки поступающих (далее – списки поступающих):</p><p class=\"ql-align-justify\">	- списки поступающих без вступительных испытаний по каждой совокупности условий поступления &nbsp;в рамках контрольных цифр и на места по договорам об оказании платных образовательных услуг;</p><p class=\"ql-align-justify\">	- списки поступающих, успешно прошедших вступительные испытания (далее – конкурсные списки), по каждому конкурсу, проводимому в соответствии с пунктом 12 Правил.</p><p class=\"ql-align-justify\"><strong style=\"color: black;\">2. </strong><span style=\"color: black;\">Конкурсные списки ранжируются следующим образом:</span></p><p class=\"ql-align-justify\">	<span style=\"color: black;\">а) по убыванию суммы конкурсных баллов (сумма баллов за вступительные испытания + баллы за индивидуальные достижения);</span></p><p class=\"ql-align-justify\">	<span style=\"color: black;\">б) при равенстве суммы конкурсных баллов – по убыванию суммы конкурсных баллов, начисленных по результатам вступительных испытаний, и по убыванию количества баллов, начисленных по результатам отдельных вступительных испытаний, в соответствии с приоритетностью вступительных испытаний, установленной Университетом (Приложение 3);</span></p><p class=\"ql-align-justify\">	<span style=\"color: black;\">в) при равенстве по предшествующим критериям более высокое место в списке занимают поступающие, имеющие преимущественное право зачисления.</span></p><p class=\"ql-align-justify\">	<strong style=\"color: black;\">3.</strong><span style=\"color: black;\"> Для зачисления, поступающие </span><strong style=\"color: red;\">тем же способом, что были поданы документы для участия в конкурсе на зачисление,</strong><span style=\"color: red;\"> &nbsp;</span><span style=\"color: black;\">представляют не позднее 18.00 по местному времени рабочего дня, установленного Университетом в качестве даты завершения приема документов, необходимых для поступления, </span><strong style=\"color: red;\">согласие на зачисление</strong><span style=\"color: black;\">. </span></p><p class=\"ql-align-justify\">	<span style=\"color: black;\">В списках поступающих по каждому поступающему указывается наличие в университете согласия на зачисление. </span></p><p class=\"ql-align-justify\">	<strong style=\"color: black;\">4.</strong><span style=\"color: black;\"> </span>Зачисление поступающих проводится в направлении от начала к концу списка поступающих, до заполнения имеющихся мест для приема.</p><p class=\"ql-align-justify\">	</p><p class=\"ql-align-justify\"><strong>5.</strong> Процедуры зачисления поступающих на обучение по программам бакалавриата и специалитета по <strong>очной</strong> и <strong>очно-заочной</strong> формам обучения на места в рамках контрольных цифр проводятся в следующие сроки:</p><p class=\"ql-align-justify\">	а) размещение на официальном сайте и на информационном стенде списков поступающих – <strong><u>19 августа</u></strong>;</p><p class=\"ql-align-justify\">	б) зачисление поступающих без вступительных испытаний, поступающих на места в пределах квоты приема лиц, имеющих особые права, поступающих на места в пределах квоты целевого обучения:</p><p class=\"ql-align-justify\">	<strong><u>21 августа в 18.00</u></strong><u>: </u></p><p class=\"ql-align-justify\">	завершается прием <strong style=\"color: red;\">согласия на зачисление</strong><span style=\"color: red;\"> </span>от лиц, одновременно подавших заявления о приеме в соответствии с двумя или более подпунктами пункта 69 Правил в различные организации высшего образования;</p><p class=\"ql-align-justify\">	<strong><u>22 августа</u> &nbsp;</strong>&nbsp;издается и размещается на официальном сайте приказ (приказы) о зачислении поступающих без вступительных испытаний, поступающих на места в пределах квоты приема лиц, имеющих особые права, поступающих на места в пределах квоты целевого обучения, представивших согласие на зачисление;</p><p class=\"ql-align-justify\">	в) первый этап зачисления по общему конкурсу:</p><p class=\"ql-align-justify\">	<strong><u>22 августа</u> </strong>количество конкурсных мест в соответствующих конкурсных списках на места в рамках контрольных цифр по общему конкурсу увеличивается на количество мест, равное числу поступающих без вступительных испытаний на места в рамках контрольных цифр, не представивших согласие на зачисление, а также на количество мест, оставшихся вакантными в пределах квоты приема лиц, имеющих особые права, и квоты целевого обучения;</p><p class=\"ql-align-justify\">	<strong><u>23 августа в 18.00: </u></strong></p><p class=\"ql-align-justify\">	завершается прием согласия на зачисление от лиц, включенных в конкурсный список, желающих быть зачисленными на первом этапе зачисления по общему конкурсу;</p><p class=\"ql-align-justify\">	в рамках каждого конкурсного списка формируется список, включающий в себя лиц, представивших оригинал документа установленного образца и согласие на зачисление, до заполнения 80 процентов конкурсных мест по общему конкурсу (далее – список первого этапа);</p><p class=\"ql-align-justify\">	<strong><u>24 августа</u> &nbsp;</strong>&nbsp;издается и размещается на официальном сайте приказ (приказы) о зачислении лиц, включенных в списки первого этапа;</p><p class=\"ql-align-justify\">	г) второй этап зачисления по общему конкурсу:</p><p class=\"ql-align-justify\">	<strong><u>24 августа</u> &nbsp;</strong>из конкурсных списков исключаются лица, зачисленные на первом этапе, количество конкурсных мест в конкурсных списках уменьшается на количество заполненных мест;</p><p class=\"ql-align-justify\">	<strong><u>25 августа в 18.00:</u></strong></p><p class=\"ql-align-justify\">	завершается прием согласия на зачисление от лиц, включенных в конкурсный список;</p><p class=\"ql-align-justify\">	лица, до установленного срока не представившие согласие на зачисление, а также отозвавшие указанное согласие, выбывают из конкурса и рассматриваются как отказавшиеся от зачисления;</p><p class=\"ql-align-justify\">	в рамках каждого конкурсного списка формируется список, включающий в себя лиц, представивших согласие на зачисление, до заполнения 100 процентов конкурсных мест по общему конкурсу (далее – список второго этапа);</p><p class=\"ql-align-justify\">	<strong><u>26 августа</u> &nbsp;</strong>&nbsp;издается и размещается на официальном сайте приказ (приказы) о зачислении лиц, включенных в списки второго этапа.</p><p class=\"ql-align-justify\">	</p><p class=\"ql-align-justify\"><strong>6.</strong> При приеме на обучение по программам бакалавриата и специалитета по <strong>заочной</strong> форме обучения на места в рамках контрольных цифр приема:</p><p class=\"ql-align-justify\">	&nbsp;а) размещение на официальном сайте и на информационном стенде списков поступающих – <strong><u>24 августа</u></strong>;</p><p class=\"ql-align-justify\">	б) зачисление поступающих без вступительных испытаний, поступающих на места в пределах квоты приема лиц, имеющих особые права, поступающих на места в пределах квоты целевого приема: </p><p class=\"ql-align-justify\">	<strong><u>26 августа</u> </strong>завершается прием согласия на зачисление от лиц, одновременно подавших заявления о приеме в соответствии с двумя или более подпунктами пункта 69 Правил в различные организации высшего образования;</p><p class=\"ql-align-justify\">	<strong><u>27 августа</u> </strong>издается и размещается на официальном сайте приказ (приказы) о зачислении поступающих без вступительных испытаний, поступающих на места в пределах квоты приема лиц, имеющих особые права, поступающих на места в пределах квоты целевого обучения, представивших оригинал документа установленного образца.</p><p class=\"ql-align-justify\">	<strong><u>27 августа</u> </strong>&nbsp;количество конкурсных мест в соответствующих конкурсных списках на места в рамках контрольных цифр по общему конкурсу увеличивается на количество мест, равное числу поступающих без вступительных испытаний на места в рамках контрольных цифр, не представивших оригинал документа установленного образца и (или) согласие на зачисление, а также на количество мест, оставшихся вакантными в пределах квоты приема лиц, имеющих особые права, и квоты целевого обучения;</p><p class=\"ql-align-justify\">	<strong><u>27 августа</u> </strong>завершается прием согласия на зачисление от лиц, включенных в конкурсный список, желающих быть зачисленными по общему конкурсу;</p><p class=\"ql-align-justify\">	<strong><u>28 августа </u>&nbsp;</strong>издается и размещается на официальном сайте приказ (приказы) о зачислении лиц до заполнения 100 процентов конкурсных мест по общему конкурсу.</p><p class=\"ql-align-justify\">	</p><p class=\"ql-align-justify\">	<strong>7.</strong> При приеме <strong>на места по договорам об оказании платных образовательных услуг</strong> (платное обучение) по программам бакалавриата и программам специалитета по очной, очно-заочной формам обучения:</p><p class=\"ql-align-justify\">	а) размещение списков поступающих на официальном сайте и на информационном стенде – <strong><u>27 августа</u></strong>;</p><p class=\"ql-align-justify\">	б) зачисление по результатам вступительных испытаний на места по договорам об оказании платных образовательных услуг (платное обучение):</p><p class=\"ql-align-justify\">	<strong><u>29 августа</u></strong> завершается прием заявлений о согласии на зачисление;</p><p class=\"ql-align-justify\">	<strong><u>31 августа</u></strong> издается приказ (приказы) о зачислении.</p><p class=\"ql-align-justify\">	&nbsp;</p><p class=\"ql-align-justify\">	<strong>8.</strong> При приеме <strong>на места по договорам об оказании платных образовательных услуг</strong> (платное обучение) по программам бакалавриата и программам специалитета по заочной форме обучения:</p><p class=\"ql-align-justify\">	а) размещение списков поступающих на официальном сайте и на информационном стенде – <strong><u>14 сентября</u></strong>;</p><p class=\"ql-align-justify\">	б) зачисление по результатам вступительных испытаний на места по договорам об оказании платных образовательных услуг (платное обучение):</p><p class=\"ql-align-justify\">	<strong><u>16 сентября</u></strong> завершается прием заявлений о согласии на зачисление;</p><p class=\"ql-align-justify\">	<strong><u>18 сентября</u></strong> издается приказ (приказы) о зачислении.</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-center\">	<strong style=\"color: red;\">ВАЖНО! Обязательным условием зачисления на места с оплатой стоимости обучения является заключение договора об оказании платных образовательных услуг и внесение предоплаты, размер которой согласуется при заключении договора.</strong></p><p><br></p>','text',NULL,27,NULL,'2020-06-04 11:49:58','2020-06-20 19:11:37',NULL),(528,'Приказ об установлении количества мест для приёма в ординатуру в 2020 году иностранных граждан и лиц без гражданства','inQKESlTkFVFTAjf05AmQ1ujlxAgbbjXgcVkpsUe.pdf',4,'Приказ об установлении количества мест для приёма в ординатуру в 2020 году иностранных граждан и лиц без гражданства.pdf','file','hi8a89kkhzf9uhxpbxqfe',NULL,523,'2020-06-24 06:32:52','2020-06-24 06:32:52','pdf'),(529,'',NULL,0,'<p>Прием документов на обучение по программам ординатуры осуществляется в следующие сроки:&nbsp;</p><p><br></p><p>&nbsp;&nbsp;- на места в рамках контрольных цифр приема -&nbsp;<strong>с 06 июля 2020 г. по 08 августа 2020 г.</strong>&nbsp;(срок завершения приема документов на обучение по программам ординатуры в рамках контрольных цифр приема продлевается&nbsp;<strong>по 24 августа 2020 г.</strong>&nbsp;при наличии незаполненных бюджетных мест после выхода приказа о зачислении на обучение по программам ординатуры в рамках контрольных цифр приема);&nbsp;</p><p>&nbsp;&nbsp;- по договорам об оказании платных образовательных услуг -&nbsp;<strong>с 06 июля 2020 г. по 25 августа 2020 г.</strong></p><p><br></p><p>&nbsp;&nbsp;Списки поступающих размещаются на официальном сайте Университета и на информационном стенде и обновляются ежедневно до издания соответствующих приказов о зачислении.</p><p><br></p><p>&nbsp;&nbsp;Зачислению на места в рамках контрольных цифр приема подлежат поступающие, представившие оригинал документа установленного образца,&nbsp;<strong>не позднее 18-00 ч. 11 августа 2020 г.</strong>&nbsp;При условии продления приема по основаниям, указанным в п. 3.15 Правил приема в ординатуру,&nbsp;<strong>не позднее 26 августа 2020 г.&nbsp;</strong></p><p><br></p><p>&nbsp;&nbsp;<strong>Не позднее 18-00 ч. 11 августа 2020 г.</strong>&nbsp;поступающий на места в рамках контрольных цифр вправе определить приоритет по специальности ординатуры. При условии продления приема по основаниям, указанным в п. 3.15 Правил приема,&nbsp;<strong>не позднее 26 августа 2020 г.</strong>&nbsp;Выбор приоритета подтверждается оригиналом документа установленного образца.</p><p><br></p><p>&nbsp;&nbsp;Зачислению на места по договорам об оказании платных образовательных услуг подлежат поступающие, представившие оригинал документа установленного образца (заявление о согласии на зачисление)&nbsp;<strong>не позднее 18-00 ч. 27 августа 2020 г.</strong></p><p>&nbsp;&nbsp;</p><p>&nbsp;&nbsp;Зачисление на обучение по программам ординатуры на места в рамках контрольных цифр приема производится приказом ректора Университета&nbsp;<strong>не позднее 14 августа.</strong>&nbsp;При условии продления приема по основаниям, указанным в п. 3.15 Правил приема в ординатуру,&nbsp;<strong>не позднее 28 августа 2020 г.&nbsp;</strong></p><p><br></p><p>&nbsp;&nbsp;Зачисление на места по договорам об оказании платных образовательных услуг производится приказом ректора Университета&nbsp;<strong>не позднее 29 августа 2020 г.</strong></p><p><br></p><p>&nbsp;&nbsp;Приказы о зачислении на обучение размещаются в день их издания на официальном сайте Университета и на информационном стенде и должны быть доступны пользователям официального сайта в течение 6 месяцев со дня их издания.</p>','text',NULL,65,NULL,'2020-06-24 06:36:02','2020-06-24 06:37:21',NULL),(113,'СТОИМОСТЬ ОБУЧЕНИЯ ДЛЯ ПОСТУПАЮЩИХ НА ПЕРВЫЙ КУРС В 2020-2021 УЧЕБНОМ ГОДУ',NULL,0,NULL,'files',NULL,18,NULL,'2020-06-18 09:19:10','2020-06-18 09:19:10',NULL),(114,'Стоимость_граждане РФ','2kuOC0ebXPFBg991MDC3wCwkPW9JEwImvIBzPJBz.pdf',0,'Высшее образование_граждане РФ.pdf','file','0hotxsggo528zi90qb3zrfj',NULL,113,'2020-06-18 09:19:10','2020-06-18 09:19:10','pdf'),(115,'Стоимость_граждане РФ (ускоренные сроки)','MgF3qno5JMFMQllFMPkdQVA9tOcg0yPCPokF9Wj3.pdf',1,'Высшее образование (ускоренное)_граждане РФ.pdf','file','mna6t46mgxb0my8cbjwran',NULL,113,'2020-06-18 09:19:10','2020-06-18 09:19:10','pdf'),(116,'Стоимость_иностр_граждане','2GwqfoICkvosT4UsT7J14724PGfNApR0fEF7TKiU.pdf',2,'Высшее образование_ иностранные граждане.pdf','file','xjthqz5pydxzxzhrfkfn8',NULL,113,'2020-06-18 09:19:10','2020-06-18 09:19:10','pdf'),(117,'СТОИМОСТЬ ОБУЧЕНИЯ ДЛЯ ПОСТУПАЮЩИХ НА ПЕРВЫЙ КУРС В 2020-2021 УЧЕБНОМ ГОДУ',NULL,0,NULL,'files',NULL,34,NULL,'2020-06-18 09:22:19','2020-06-18 09:22:19',NULL),(118,'Стоимость обучения для СПО','Nh2pBb8aPgX1650KWqBx7wL9Ljw1vKoEikKYsMLT.pdf',0,'Среднее профессиональное образование_граждане РФ.pdf','file','r8h2hktpd72oekkfonxxi',NULL,117,'2020-06-18 09:22:19','2020-06-18 09:22:19','pdf'),(111,NULL,NULL,4,NULL,'files',NULL,27,NULL,'2020-06-11 11:35:53','2020-06-11 11:35:53',NULL),(422,NULL,NULL,0,NULL,'files',NULL,51,NULL,'2020-06-19 07:50:41','2020-06-19 07:50:41',NULL),(423,'I. ПРИЁМ ДОКУМЕНТОВ',NULL,1,'<p class=\"ql-align-justify\">	<strong>1.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</strong>Начало приема документов, необходимых для поступления, на все формы обучения и направления подготовки – <strong><u>20 июня</u></strong>. Прием документов осуществляется <strong style=\"color: red;\">ТОЛЬКО </strong>дистанционно!</p><p class=\"ql-align-justify\">	В личном кабинете абитуриента необходимо предоставить:</p><p class=\"ql-align-justify\">	– скан документа, удостоверяющего личность;</p><p class=\"ql-align-justify\">	– скан документа об образовании (диплом бакалавра, диплом специалиста);</p><p class=\"ql-align-justify\">	– скан договора о целевом обучении (если имеется);</p><p class=\"ql-align-justify\">	– сканы документов, подтверждающих наличие индивидуальных достижений (в соответствии с перечнем, приведенным в Приложении 5 к Правилам приема). </p><p class=\"ql-align-justify\">	<strong>2.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</strong>Все поступающие, независимо от уровня, формы и&nbsp;условий получения образования, в соответствии с законодательством должны представить в приемную комиссию <strong style=\"color: red;\">согласие на зачисление </strong><span style=\"color: black;\">тем же способом, каким было подано заявление на участие в конкурсе, то есть дистанционно</span>.&nbsp;Лица, не представившие в установленные сроки согласие на зачисление, зачислены не будут. </p><p class=\"ql-align-justify\"><strong style=\"color: red;\">ВАЖНО! Оригинал документа об образовании нужно будет предоставить в вуз в течение первого года обучения!</strong></p><p class=\"ql-align-justify\">	<strong>3.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</strong>При приеме на обучение по программам магистратуры по <strong>очной</strong> и <strong>очно-заочной</strong> формам обучения в рамках контрольных цифр прием документов, необходимых для поступления, завершается – <strong><u>3 августа. </u></strong>Вступительные испытания проводятся в период с <strong><u>4 по 8 августа</u></strong>. </p><p class=\"ql-align-justify\">	<strong>4.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</strong>При приеме на обучение по программам магистратуры по <strong>заочной</strong> форме обучения в рамках контрольных цифр &nbsp;прием документов, необходимых для поступления, завершается – <strong><u>7 августа. </u></strong>Вступительные испытания проводятся в период с <strong><u>8 по 11 августа</u></strong>. </p><p class=\"ql-align-justify\">	<strong>5.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</strong>При приеме на обучение по программам магистратуры по <strong>очной,</strong> <strong>очно-заочной</strong> и заочной формам обучения по договорам об оказании платных образовательных услуг прием документов, необходимых для поступления, завершается – &nbsp;<strong><u>24 августа</u></strong>. Вступительные испытания проводятся в период с <strong><u>25 по 27 августа</u></strong>. </p><p class=\"ql-align-justify\">	<strong>6.</strong> При поступлении на обучение по специальностям и направлениям подготовки: </p><p class=\"ql-align-justify\"><em>«Лечебное дело», «Педиатрия», «Стоматология», «Фармация», «Ветеринария», «Агроинженерия», «Теплоэнергетика и теплотехника», «Электроэнергетика и электротехника», «Эксплуатация транспортно-технологических машин и комплексов»,</em> необходима <strong>медицинская справка</strong>, содержащая сведения о проведении медицинского осмотра в порядке, установленном постановлением Правительства Российской Федерации от 14 августа 2013 г. № 697.</p><p class=\"ql-align-justify\">	Медицинская справка признается действительной, если она получена не ранее года до дня завершения приема документов и вступительных испытаний.</p><p class=\"ql-align-justify\">	<strong style=\"color: red;\">ВАЖНО! Пройти медосмотр и предоставить медицинскую справку в вуз можно в течение первого года обучения!</strong></p><p><br></p>','text',NULL,51,NULL,'2020-06-19 07:50:41','2020-06-19 07:54:12',NULL),(110,'IV. УЧЁТ РЕЗУЛЬТАТОВ ИНДИВИДУАЛЬНЫХ ДОСТИЖЕНИЙ',NULL,3,'<p><strong>1.</strong> Поступающие на обучение вправе представить сведения о своих индивидуальных достижениях, результаты которых учитываются при приеме на обучение.</p><p><br></p><p><strong>2.</strong> Учет индивидуальных достижений осуществляется посредством начисления баллов за индивидуальные достижения. Указанные баллы начисляются поступающему, представившему документы, подтверждающие получение результатов индивидуальных достижений, и включаются в сумму конкурсных баллов.</p><p><br></p><p><strong>3.</strong> При приеме на обучение по программам бакалавриата, программам специалитета Университет начисляет баллы за следующие индивидуальные достижения:</p><p>	а) наличие статуса чемпиона и призера Олимпийских игр, Паралимпийских игр и Сурдлимпийских игр, чемпиона мира, чемпиона Европы, победителя первенства мира, первенства Европы по видам спорта, включенным в программы Олимпийских игр, Паралимпийских игр и Сурдлимпийских игр; наличие золотого значка, полученного за результаты сдачи норм физкультурного комплекса «Готов к труду и обороне» (подтверждается удостоверением к нему); осуществление волонтерской (добровольческой) деятельности (при наличии книжки волонтера) – 2 балла;</p><p>	б) наличие аттестата о среднем общем образовании с отличием или аттестата о среднем общем образовании (среднем (полном) общем образовании), содержащего сведения о награждении золотой или серебряной медалью, диплома среднего профессионального образования с отличием – 5 баллов;</p><p>	в) участие и (или) результаты участия поступающих в олимпиадах (не используемые для получения особых прав и (или) преимуществ при поступлении на обучение по конкретной совокупности условий поступления) и иных интеллектуальных и (или) творческих конкурсах, физкультурных мероприятиях и спортивных мероприятиях, проводимых в целях выявления и поддержки лиц, проявивших выдающиеся способности – не более 3 баллов:</p><ul><li>участие во всех этапах Всероссийской олимпиады школьников (за исключением школьного и муниципального этапов), в олимпиадах школьников, включенных в перечень, утвержденный Министерством науки и высшего образования Российской Федерации; наличие статуса победителя регионального или вузовского чемпионата по профессиональному мастерству, проводимого Союзом «Молодые профессионалы (Ворлдскиллс Россия)»; наличие статуса победителя чемпионата по профессиональному мастерству среди инвалидов и лиц с ограниченными возможностями здоровья «Абилимпикс», – 3 балла;</li><li>результаты (победитель или призер) участия в олимпиадах и конкурсах, проводимых в Республики Мордовия, – 2 балла;</li><li>результаты (победитель или призер) участия в олимпиадах и конкурсах, проводимых МГУ им Н.П. Огарёва, – 2 балла.</li></ul><p>Указанные результаты могут быть учтены в качестве индивидуального достижения, если подтверждающие документы получены не ранее 4 лет до дня завершения приема документов от поступающего и вступительных испытаний.</p>','text',NULL,27,NULL,'2020-06-11 11:34:14','2020-06-19 07:06:15',NULL),(119,'ПРАВИЛА ПРИЕМА НА ПРОГРАММЫ СРЕДНЕГО ПРОФЕССИОНАЛЬНОГО ОБРАЗОВАНИЯ НА 2020-2021 УЧЕБНЫЙ ГОД',NULL,0,NULL,'files',NULL,13,NULL,'2020-06-18 09:25:23','2020-06-18 09:26:11',NULL),(120,'ПРАВИЛА ПРИЕМА СПО','gTvyhZRk0rG3I8ZWgLqieztpQIMpruOqGEWQfklA.pdf',0,'Правила приема СПО_2020-21.pdf','file','lzcpfqhlwup81h5n271bt7',NULL,119,'2020-06-18 09:25:23','2020-06-18 09:26:11','pdf'),(121,'ИНФОРМАЦИЯ ОБ ОСОБЫХ ПРАВАХ И ПРЕИМУЩЕСТВАХ, УКАЗАННЫХ В ПУНКТАХ 33, 36 И 37 ПРАВИЛ ПРИЕМА',NULL,6,NULL,'files',NULL,1,NULL,'2020-06-18 10:18:45','2020-06-18 10:18:45',NULL),(122,'ИНФОРМАЦИЯ ОБ ОСОБЫХ ПРАВАХ И ПРЕИМУЩЕСТВАХ, УКАЗАННЫХ В ПУНКТА